import Nav from './components/Nav'
import Main from './components/Main'
import './App.scss';

const App = () =>{
  return (
    <div className="outerWrap">
      <div className="App">
        <Nav/>
        <Main />
      </div>
      <div className="travelControls"> travel controls </div>
    </div>
  )
}

export default App
